import React from 'react';
import {Link} from 'react-router-dom';

export default class Details extends React.Component {
  render() {
    return(
      <div>
          <Link to='/'>Back to Home Page</Link>
        <h1>Hello, Welcome to the movie details Page</h1>
      </div>
    );
  }

}
